import { Carousel } from "3d-react-carousal";
import React, { Component }  from 'react';
// var Carousel = require( '3d-react-carousal').Carousel;

let slides = [
//   <img src="https://www.nasa.gov/sites/default/files/styles/full_width_feature/public/thumbnails/image/pia20027_updated.jpg" alt="1" />,
  <img src="https://picsum.photos/800/300/?random" alt="1" width={500} height={300} />,
  <img src="https://picsum.photos/800/301/?random" alt="2" width={500} height={300}/>,
  <img src="https://picsum.photos/800/302/?random" alt="3" width={500} height={300}/>,
  <img src="https://picsum.photos/800/303/?random" alt="4" width={500} height={300}/>,
  <img src="https://picsum.photos/800/304/?random" alt="5" width={500} height={300}/>,
];

export const ImgCategory = () => {
  return <Carousel slides={slides} /*autoplay={true}*/ interval={1000} />;
}
